import React from 'react';
import { Link } from 'react-router-dom';

const NavBar = ({ userExists, logOut }) => {
  console.log(userExists)
  return (
    <nav>
      <Link to="/" onClick={logOut}> Logout</Link>
    </nav>
  );
};

export default NavBar;
